import React from 'react';

const Landing = () => {
    return (
        <section className="landing">
            <div className="dark-overlay">
            <div className="landing-inner">
                <h1 className="x-large">Zawlbuk</h1>
                <p className="lead">
                Account siam la,Mizote thiamna lama hma kan sawn theih nan Mizotawng ngeiin i field of study huang chhunga mi article rawn ziak rawh le 
                </p>
                <div className="buttons">
                <Link to="register.html" className="btn btn-primary">Sign Up</Link>
                <Link to="login.html" className="btn btn-light">Login</Link>
                </div>
            </div>
            </div>
        </section>
    )
}
export default Landing;
